import './Customer.css'

const Customer = (props) => {
   return (<div className="customer" onClick={props.handleClick}>
        <span>{props.data.name}</span>
        <span className="span-check">{props.check ? 'RewardPoints : '+props.data.rewardPoints : null}</span>
    </div>)
}
export default Customer
